    [],nt"revision_timestamp": "2016-05-11T21:15:57.519882",nt"name": "1999-yellow-river-aerial-photos-central-wisconsin",nt"isopen":
    false,nt"url": null,nt"notes": "The 25-mile stretch of the Yellow River
    adjacent to the Necedah National Wildlife Refuge in Central Wisconsin provides valuable
    habitat to numerous species of concern including the Red-shouldered hawk (Buteo
    lineatus), the Cerulean warbler (Dendroica cerulea), the Eastern massasaugua rattlesnake
    (Sistrurus catenatus), and the Karner blue butterfly (Lycaeides melissa samuelis).
    Since very little data exist regarding the location and composition of these habitats,
    a detailed land cover/land use (LCU) map is needed to better define and more effectively
    manage these areas of concern.",nt"license_title": null,nt"extras": [{ntt"key":
